 You can stop a C program by using the `exit()` function. The `exit()` function is a part of the `stdlib.h` library and it is used to terminate the execution of the program.

Here is an example of how to use the `exit()` function:

```c
#include <stdio.h>
#include <stdlib.h>

int main() {
    printf("This is a C program.\n");
    exit(0);
    return 0;
}
```

In this example, the program will print "This is a C program." and then terminate its execution.

If you want to terminate the program with a specific exit code, you can pass an integer value to the `exit()` function. The exit code is used to indicate the status of the program. For example:

```c
#include <stdio.h>
#include <stdlib.h>

int main() {
    printf("This is a C program.\n");
    exit(1);
    return 0;
}
```

In this example, the program will print "This is a C program." and then terminate its execution with an exit code of 1.
